    /**
     * * Given a positive integer n, return the count of the numbers of n-digit
     * positive integers that start or end with 1.
     */
    public static int startsOneEnds(int n) {
        int count = 0;
        int start = 1;
        int end = 1;
        for (int i = 1; i < n; i++) {
            start *= 10;
            end *= 10;
        }
        for (int i = start; i < end * 10; i++) {
            if (i % 10 == 1 || i / start == 1) {
                count++;
            }
        }
        return count;
    }
}

